const Login = (props) => {
  const handleSubmit = (e) => {
    e.preventDefault();
    localStorage.setItem("token", true);
    props.history.push("/home");
  };

  return (
    <div>
      <form style={{ width: "100%" }} onSubmit={handleSubmit}>
        <fieldset
          style={{
            width: "60%",
            margin: "auto",
            marginBottom: "2%",
            textAlign: "end",
          }}
        >
          <legend>Login</legend>
          <input
            id="username"
            placeholder="UserName"
            className="fields"
            type="text"
          ></input>

          <input
            id="password"
            placeholder="Password"
            className="fields"
            type="password"
          ></input>

          <input type="submit" className="buttons" style={{ width: "20%" }} />
        </fieldset>
      </form>
    </div>
  );
};

export default Login;
